(13, 9, 'More visual ways to shop', 'Ø§Ù„Ù…Ø²ÙŠØ¯ Ù…Ù† Ø§Ù„Ø·Ø±Ù‚ Ø§Ù„Ù…Ø±Ø¦ÙŠØ© Ù„Ù„ØªØ³ÙˆÙ‚', '×“×¨×›×™× ×—×–×•×ª×™×•×ª ×™×•×ª×¨ ×œ×—× ×•×ª', 'More visual ways to shop', '×“×¨×›×™× ×—×–×•×ª×™×•×ª ×™×•×ª×¨ ×œ×—× ×•×ª', 'Ø§Ù„Ù…Ø²ÙŠØ¯ Ù…Ù† Ø§Ù„Ø·Ø±Ù‚ Ø§Ù„Ù…Ø±Ø¦ÙŠØ© Ù„Ù„ØªØ³ÙˆÙ‚', '<p><img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666087775Blog_Post_Hero_Image_gImbPzT.max-1000x1000.png\" style=\"border-style:solid; border-width:5px; height:282px; margin:12px 250px; width:500px\" />Today we&rsquo;re introducing a new way to unlock the shopping experience on Google. In the U.S., when you search the word&nbsp;<em>&ldquo;</em>shop&rdquo; followed by whatever item you&#39;re looking for, you&rsquo;ll access a visual feed of products, research tools and nearby inventory related to that product. We&rsquo;re also expanding the&nbsp;<a href=\"https://blog.google/products/shopping/search-on-2021-shopping/\">shoppable search experience</a>&nbsp;beyond apparel to all categories &mdash; from electronics to beauty &mdash; and more regions on mobile (and coming soon to desktop).</p>\r\n\r\n<p>&nbsp;</p>', '<pre>\r\nÙ†Ù‚Ø¯Ù… Ø§Ù„ÙŠÙˆÙ… Ø·Ø±ÙŠÙ‚Ø© Ø¬Ø¯ÙŠØ¯Ø© Ù„Ø¥Ø·Ù„Ø§Ù‚ Ø§Ù„Ø¹Ù†Ø§Ù† Ù„ØªØ¬Ø±Ø¨Ø© Ø§Ù„ØªØ³ÙˆÙ‚ Ø¹Ù„Ù‰ Google. ÙÙŠ Ø§Ù„ÙˆÙ„Ø§ÙŠØ§Øª Ø§Ù„Ù…ØªØ­Ø¯Ø© ØŒ Ø¹Ù†Ø¯Ù…Ø§ ØªØ¨Ø­Ø« Ø¹Ù† ÙƒÙ„Ù…Ø© &quot;Ù…ØªØ¬Ø±&quot; Ù…ØªØ¨ÙˆØ¹Ø© Ø¨Ø£ÙŠ Ø¹Ù†ØµØ± ØªØ¨Ø­Ø« Ø¹Ù†Ù‡ ØŒ Ø³ØªØªÙ…ÙƒÙ† Ù…Ù† Ø§Ù„ÙˆØµÙˆÙ„ Ø¥Ù„Ù‰ Ù…ÙˆØ¬Ø² Ù…Ø±Ø¦ÙŠ Ù„Ù„Ù…Ù†ØªØ¬Ø§Øª ÙˆØ£Ø¯ÙˆØ§Øª Ø§Ù„Ø¨Ø­Ø« ÙˆØ§Ù„Ù…Ø®Ø²ÙˆÙ† Ø§Ù„Ù‚Ø±ÙŠØ¨ Ø§Ù„Ù…Ø±ØªØ¨Ø· Ø¨Ù‡Ø°Ø§ Ø§Ù„Ù…Ù†ØªØ¬. Ù†Ø¹Ù…Ù„ Ø£ÙŠØ¶Ù‹Ø§ Ø¹Ù„Ù‰ ØªÙˆØ³ÙŠØ¹ Ù†Ø·Ø§Ù‚ ØªØ¬Ø±Ø¨Ø© Ø§Ù„Ø¨Ø­Ø« Ø§Ù„Ù‚Ø§Ø¨Ù„Ø© Ù„Ù„ØªØ³ÙˆÙ‘Ù‚ Ø¨Ù…Ø§ ÙŠØªØ¬Ø§ÙˆØ² Ø§Ù„Ù…Ù„Ø§Ø¨Ø³ Ù„ØªØ´Ù…Ù„ Ø¬Ù…ÙŠØ¹ Ø§Ù„ÙØ¦Ø§Øª - Ù…Ù† Ø§Ù„Ø¥Ù„ÙƒØªØ±ÙˆÙ†ÙŠØ§Øª Ø¥Ù„Ù‰ Ù…Ø³ØªØ­Ø¶Ø±Ø§Øª Ø§Ù„ØªØ¬Ù…ÙŠÙ„ - ÙˆØ§Ù„Ù…Ø²ÙŠØ¯ Ù…Ù† Ø§Ù„Ù…Ù†Ø§Ø·Ù‚ Ø¹Ù„Ù‰ Ø§Ù„Ø¬ÙˆÙ‘Ø§Ù„ (ÙˆÙ‚Ø±ÙŠØ¨Ù‹Ø§ Ø¹Ù„Ù‰ Ø£Ø¬Ù‡Ø²Ø© Ø§Ù„ÙƒÙ…Ø¨ÙŠÙˆØªØ± Ø§Ù„Ù…ÙƒØªØ¨ÙŠØ©).</pre>', '<pre>\r\n×”×™×•× ×× ×—× ×• ××¦×™×’×™× ×“×¨×š ×—×“×©×” ×œ×¤×ª×•×— ××ª ×—×•×•×™×ª ×”×§× ×™×™×” ×‘-Google. ×‘××¨×”&quot;×‘, ×›×©××ª×” ××—×¤×© ××ª ×”××™×œ×” &quot;×—× ×•×ª&quot; ×•××—×¨×™×” ×›×œ ×¤×¨×™×˜ ×©××ª×” ××—×¤×©, ×ª×§×‘×œ ×’×™×©×” ×œ×¢×“×›×•×Ÿ ×—×–×•×ª×™ ×©×œ ××•×¦×¨×™×, ×›×œ×™ ××—×§×¨ ×•××œ××™ ×§×¨×•×‘ ×”×§×©×•×¨ ×œ××•×¦×¨ ×–×”. ×× ×—× ×• ×’× ××¨×—×™×‘×™× ××ª ×—×•×•×™×™×ª ×”×—×™×¤×•×© ×”× ×™×ª× ×ª ×œ×§× ×™×” ××¢×‘×¨ ×œ×œ×‘×•×© ×œ×›×œ ×”×§×˜×’×•×¨×™×•×ª - ×××œ×§×˜×¨×•× ×™×§×” ×•×¢×“ ×™×•×¤×™ - ×•×œ××–×•×¨×™× × ×•×¡×¤×™× ×‘× ×™×™×“ (×•×‘×§×¨×•×‘ ×™×’×™×¢ ×œ××—×©×‘ ×©×•×œ×—× ×™).</pre>', 1, 1, 0, '2022-10-18 09:29:08', '2022-12-02 10:00:20'),
(14, 14, 'Cafe hopping in Noida', 'Ù…Ù‚Ù‡Ù‰ Ø§Ù„ØªÙ†Ù‚Ù„ ÙÙŠ Ù†ÙˆÙŠØ¯Ø§', '×‘×™×ª ×§×¤×” ×©×•×¤×™× ×’ ×‘× ×•×™×“×”', 'Noida might be a paradise for home buyers but it still needs to go a long way for becoming a foodieâ€™s haven.', 'Ù„Ù‚Ù„ÙŠÙ„Ø© ÙÙŠ Ù†ÙˆÙŠØ¯Ø§ ØªØ³ØªØ­Ù‚ Ø§Ù„Ø²ÙŠØ§Ø±Ø© Ø­Ù‚Ù‹Ø§. Ø³ÙˆÙ‚ Ø§Ù„Ù‚Ø·Ø§Ø¹ -18 ÙÙŠ Ù†ÙˆÙŠØ¯Ø§ ÙˆØ§Ù„Ø°ÙŠ ÙŠØµØ§Ø¯Ù Ø£Ù† ÙŠÙƒÙˆÙ† Ù…Ø±ÙƒØ²Ù‹Ø§', '×š ×œ×’×Ÿ ×¢×“×Ÿ ×©×œ ××•×›×œ×™×. ×œ××¨×•×ª ××™×¢×•×˜ ×”××¤×©×¨×•×™×•×ª, ×‘×ª×™ ×”×§×¤×” ×”××¢×˜×™× ×”××œ×” ×‘× ×•×™×“×”', '<p><a href=\"https://timesofindia.indiatimes.com/travel/Noida/travel-guide/cs49520386.cms\">Noida</a>&nbsp;might be a paradise for home buyers but it still needs to go a long way for becoming a foodie&rsquo;s haven. Despite the paucity of choices, these handful cafes in Noida are really worth visiting. The sector-18 market of Noida which happens to be a commercial hub, has a few leading joints, which are identifiable favourites. Take&nbsp;<a href=\"https://timesofindia.indiatimes.com/travel/Mumbai/travel-guide/cs23958811.cms\">Mumbai</a>&nbsp;Matinee with its alluring typical Bollywood setting or the Paddy&rsquo;s Cafe that is frequented by office-goers looking for a quick time-out with their buddies. Notable in its contemporary charm, the Burbee&rsquo;s Cafe wins the heart of youth whereas Theos and Kaffiiaa offer respite from cheap Italian versions of pizzas and pastas <img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666088506download (1)1.jpg\" style=\"border-style:solid; border-width:5px; height:168px; margin-left:250px; margin-right:250px; width:300px\" />.</p>', '<pre>\r\nÙ‚Ø¯ ØªÙƒÙˆÙ† Ù†ÙˆÙŠØ¯Ø§ Ø¬Ù†Ø© Ù„Ù…Ø´ØªØ±ÙŠ Ø§Ù„Ù…Ù†Ø§Ø²Ù„ ÙˆÙ„ÙƒÙ†Ù‡Ø§ Ù„Ø§ ØªØ²Ø§Ù„ Ø¨Ø­Ø§Ø¬Ø© Ø¥Ù„Ù‰ Ù‚Ø·Ø¹ Ø´ÙˆØ· Ø·ÙˆÙŠÙ„ Ù„ØªØµØ¨Ø­ Ù…Ù„Ø§Ø°Ù‹Ø§ Ù„Ø¹Ø´Ø§Ù‚ Ø§Ù„Ø·Ø¹Ø§Ù…. Ø¹Ù„Ù‰ Ø§Ù„Ø±ØºÙ… Ù…Ù† Ù†Ø¯Ø±Ø© Ø§Ù„Ø®ÙŠØ§Ø±Ø§Øª ØŒ ÙØ¥Ù† Ù‡Ø°Ù‡ Ø§Ù„Ù…Ù‚Ø§Ù‡ÙŠ Ø§Ù„Ù‚Ù„ÙŠÙ„Ø© ÙÙŠ Ù†ÙˆÙŠØ¯Ø§ ØªØ³ØªØ­Ù‚ Ø§Ù„Ø²ÙŠØ§Ø±Ø© Ø­Ù‚Ù‹Ø§. Ø³ÙˆÙ‚ Ø§Ù„Ù‚Ø·Ø§Ø¹ -18 ÙÙŠ Ù†ÙˆÙŠØ¯Ø§ ÙˆØ§Ù„Ø°ÙŠ