px\" /></pre>', 1, 0, 2, '2022-10-18 10:22:28', '2022-12-02 10:22:09'),
(17, 14, 'Coffee', 'Ù‚Ù‡ÙˆØ©', '×§×¤×”', 'CoffeeÂ is a drink prepared from roastedÂ coffee beans. Darkly colored, bitter, and slightlyÂ acidic, coffee has aÂ stimulatingÂ effect on humans, primarily due to itsÂ caffeineÂ content. It is the most popular hot drink in the world.', 'Ø§Ù„Ù‚Ù‡ÙˆØ© Ù…Ø´Ø±ÙˆØ¨ Ù…Ø¹Ø¯ Ù…Ù† Ø­Ø¨ÙˆØ¨ Ø§Ù„Ø¨Ù† Ø§Ù„Ù…Ø­Ù…ØµØ©. Ø§Ù„Ù‚Ù‡ÙˆØ© Ø°Ø§Øª Ø§Ù„Ø£Ù„ÙˆØ§Ù† Ø§Ù„Ø¯Ø§ÙƒÙ†Ø© ÙˆØ§Ù„Ù…Ø±Ø© ÙˆØ§Ù„Ø­Ù…Ø¶ÙŠØ© Ù‚Ù„ÙŠÙ„Ø§Ù‹ Ù„Ù‡Ø§ ØªØ£Ø«ÙŠØ± Ù…Ø­ÙØ² Ø¹Ù„Ù‰ Ø§Ù„Ø¨Ø´Ø± ØŒ ÙˆÙŠØ±Ø¬Ø¹ Ø°Ù„Ùƒ Ø£Ø³Ø§Ø³Ù‹Ø§ Ø¥Ù„Ù‰ Ù…Ø­ØªÙˆØ§Ù‡Ø§ Ù…Ù† Ø§Ù„ÙƒØ§ÙÙŠÙŠÙ†. Ø¥Ù†Ù‡ Ø§Ù„Ù…Ø´Ø±ÙˆØ¨ Ø§Ù„Ø³Ø§Ø®Ù† Ø§Ù„Ø£ÙƒØ«Ø± Ø´Ø¹Ø¨ÙŠØ© ÙÙŠ Ø§Ù„Ø¹Ø§Ù„Ù….', '×§×¤×” ×”×•× ××©×§×” ×”××•×›×Ÿ ××¤×•×œ×™ ×§×¤×” ×§×œ×•×™×™×. ×œ×§×¤×” ×‘×¢×œ ×¦×‘×¢ ×›×”×”, ××¨ ×•××¢×˜ ×—×•××¦×™, ×™×© ×”×©×¤×¢×” ××¢×•×¨×¨×ª ×¢×œ ×‘× ×™ ××“×, ×‘×¢×™×§×¨ ×‘×©×œ ×ª×›×•×œ×ª ×”×§×¤××™×Ÿ ×©×œ×•. ×–×”×• ×”××©×§×” ×”×—× ×”×¤×•×¤×•×œ×¨×™ ×‘×™×•×ª×¨ ×‘×¢×•×œ×.', '<p><strong>Coffee</strong>&nbsp;is a drink prepared from roasted&nbsp;<a href=\"https://en.wikipedia.org/wiki/Coffee_bean\">coffee beans</a>. Darkly colored, bitter, and slightly&nbsp;<a href=\"https://en.wikipedia.org/wiki/Acid\">acidic</a>, coffee has a&nbsp;<a href=\"https://en.wikipedia.org/wiki/Stimulant\">stimulating</a>&nbsp;effect on humans, primarily due to its&nbsp;<a href=\"https://en.wikipedia.org/wiki/Caffeine\">caffeine</a>&nbsp;content. It is the most popular hot drink in the world.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Seeds of the&nbsp;<em><a href=\"https://en.wikipedia.org/wiki/Coffea\">Coffea</a></em>&nbsp;plant&#39;s fruits are separated to produce unroasted green coffee beans. The beans are&nbsp;<a href=\"https://en.wikipedia.org/wiki/Coffee_roasting\">roasted</a>&nbsp;and then ground into fine particles that are typically steeped in hot water before being filtered out, producing a cup of coffee. It is usually served hot, although chilled or&nbsp;<a href=\"https://en.wikipedia.org/wiki/Iced_coffee\">iced coffee</a>&nbsp;is common. Coffee can be prepared and presented in a variety of ways (e.g.,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Espresso\">espresso</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/French_press\">French press</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Caff%C3%A8_latte\">caff&egrave; latte</a>, or already-brewed&nbsp;<a href=\"https://en.wikipedia.org/wiki/Canned_coffee\">canned coffee</a>).&nbsp;<a href=\"https://en.wikipedia.org/wiki/Sugar\">Sugar</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Sugar_substitute\">sugar substitutes</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Milk\">milk</a>, and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Cream\">cream</a>&nbsp;are often used to lessen the bitter taste or enhance the flavor.<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666095534download (6).jpg\" style=\"border-style:solid; border-width:5px; height:194px; margin:5px 250px; width:259px\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666095705download (7).jpg\" style=\"border-style:solid; border-width:5px; height:183px; margin-left:250px; margin-right:250px; width:275px\" /></p>', '<pre>\r\nØ§Ù„Ù‚Ù‡ÙˆØ© Ù…Ø´Ø±ÙˆØ¨ Ù…Ø¹Ø¯ Ù…Ù† Ø­Ø¨ÙˆØ¨ Ø§Ù„Ø¨Ù† Ø§Ù„Ù…Ø­Ù…ØµØ©. Ø§Ù„Ù‚Ù‡ÙˆØ© Ø°Ø§Øª Ø§Ù„Ø£Ù„ÙˆØ§Ù† Ø§Ù„Ø¯Ø§ÙƒÙ†Ø© ÙˆØ§Ù„Ù…Ø±Ø© ÙˆØ§Ù„Ø­Ù…Ø¶ÙŠØ© Ù‚Ù„ÙŠÙ„Ø§Ù‹ Ù„Ù‡Ø§ ØªØ£Ø«ÙŠØ± Ù…Ø­ÙØ² Ø¹Ù„Ù‰ Ø§Ù„Ø¨Ø´Ø± ØŒ ÙˆÙŠØ±Ø¬Ø¹ Ø°Ù„Ùƒ Ø£Ø³Ø§Ø³Ù‹Ø§ Ø¥Ù„Ù‰ Ù…Ø­ØªÙˆØ§Ù‡Ø§ Ù…Ù† Ø§Ù„ÙƒØ§ÙÙŠÙŠÙ†. Ø¥Ù†Ù‡ Ø§Ù„Ù…Ø´Ø±ÙˆØ¨ Ø§Ù„Ø³Ø§Ø®Ù† Ø§Ù„Ø£ÙƒØ«Ø± Ø´Ø¹Ø¨Ù