(20, 15, 'T20 World Cup 2022: The saga of unsavoury India-Bangladesh matches continues', 'ÙƒØ£Ø³ Ø§Ù„Ø¹Ø§Ù„Ù… T20 2022: ØªØ³ØªÙ…Ø± Ù…Ù„Ø­Ù…Ø© Ø§Ù„Ù…Ø¨Ø§Ø±ÙŠØ§Øª Ø§Ù„Ø¨ØºÙŠØ¶Ø© Ø¨ÙŠÙ† Ø§Ù„Ù‡Ù†Ø¯ ÙˆØ¨Ù†Ø¬Ù„Ø§Ø¯ÙŠØ´', '×’×‘×™×¢ ×”×¢×•×œ× T20 2022: ×¡××’×ª ×”××©×—×§×™× ×”×œ× ×˜×¢×™××™× ×©×œ ×”×•×“×•-×‘× ×’×œ×“×© × ××©×›×ª', 'Virat Kohli played only four innings last month but he churned out three memorable knocks, including a magical 82* against Pakistan in the T20 World Cup.', 'Ù„Ø¹Ø¨ ÙÙŠØ±Ø§Øª ÙƒÙˆÙ‡Ù„ÙŠ Ø£Ø±Ø¨Ø¹ Ø¬ÙˆÙ„Ø§Øª ÙÙ‚Ø· Ø§Ù„Ø´Ù‡Ø± Ø§Ù„Ù…Ø§Ø¶ÙŠ ØŒ Ù„ÙƒÙ†Ù‡ ØªØ³Ø¨Ø¨ ÙÙŠ Ø«Ù„Ø§Ø« Ø¶Ø±Ø¨Ø§Øª Ù„Ø§ ØªÙ†Ø³Ù‰ ØŒ Ø¨Ù…Ø§ ÙÙŠ Ø°Ù„Ùƒ 82 * Ø§Ù„Ø³Ø­Ø±ÙŠØ© Ø¶Ø¯ Ø¨Ø§ÙƒØ³ØªØ§Ù† ÙÙŠ ÙƒØ£Ø³ Ø§Ù„Ø¹Ø§Ù„Ù… T20.', '×•×™×¨×˜ ×§×•×”×œ×™ ×©×™×—×§ ×¨×§ ××¨×‘×¢×” ×¡×™×‘×•×‘×™× ×‘×—×•×“×© ×©×¢×‘×¨, ××‘×œ ×”×•× ×”×•×¦×™× ×©×œ×•×© ×“×¤×™×§×•×ª ×‘×œ×ª×™ × ×©×›×—×•×ª, ×›×•×œ×œ 82* ×§×¡×•× ××•×œ ×¤×§×™×¡×˜×Ÿ ×‘×’×‘×™×¢ ×”×¢×•×œ× T20.', '<p>As admitted by Kohli himself, it was the best T20I knock he has ever played. India looked down and out of the contest when they were reduced to 31/4 while chasing 160, but Kohli stepped up and played a match-winning hand of 82* from just 53 deliveries to guide them home.&nbsp;</p>\r\n\r\n<p>Apart from that, the 33-year-old also played an excellent knock of 49* from just 28 deliveries against South Africa in Guwahati towards the start of the month. He also followed up his majestic knock against Pakistan in the T20 World Cup with another composed 62* from 44 deliveries against Netherlands. His only blip came in Perth when he was dismissed for just 12 against South Africa.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1667541072download (1)