(34, 'Cafe hopping in Noida', 'Ù…Ù‚Ù‡Ù‰ Ø§Ù„ØªÙ†Ù‚Ù„ ÙÙŠ Ù†ÙˆÙŠØ¯Ø§', '×‘×™×ª ×§×¤×” ×©×•×¤×™× ×’ ×‘× ×•×™×“×”', 'Cafe hopping in NoidaCafe hopping in NoidaCafe hopping in NoidaCafe hopping in Noida', 'Ù…Ù‚Ù‡Ù‰ Ø§Ù„ØªÙ†Ù‚Ù„ ÙÙŠ Ù†ÙˆÙŠØ¯Ø§Ù…Ù‚Ù‡Ù‰ Ø§Ù„ØªÙ†Ù‚Ù„ ÙÙŠ Ù†ÙˆÙŠØ¯Ø§Ù…Ù‚Ù‡Ù‰ Ø§Ù„ØªÙ†Ù‚Ù„ ÙÙŠ Ù†ÙˆÙŠØ¯Ø§Ù…Ù‚Ù‡Ù‰ Ø§Ù„ØªÙ†Ù‚Ù„ ÙÙŠ Ù†ÙˆÙŠØ¯Ø§', '×‘×™×ª ×§×¤×” ×©×•×¤×™× ×’ ×‘× ×•×™×“×”×‘×™×ª ×§×¤×” ×©×•×¤×™× ×’ ×‘× ×•×™×“×”×‘×™×ª ×§×¤×” ×©×•×¤×™× ×’ ×‘× ×•×™×“×”', '<p><a href=\"https://timesofindia.indiatimes.com/travel/Noida/travel-guide/cs49520386.cms\">Noida</a>&nbsp;might be a paradise for home buyers but it still needs to go a long way for becoming a foodie&rsquo;s haven. Despite the paucity of choices, these handful cafes in Noida are really worth visiting. The sector-18 market of Noida which happens to be a commercial hub, has a few leading joints, which are identifiable favourites. Take&nbsp;<a href=\"https://timesofindia.indiatimes.com/travel/Mumbai/travel-guide/cs23958811.cms\">Mumbai</a>&nbsp;Matinee with its alluring typical Bollywood setting or the Paddy&rsquo;s Cafe that is frequented by office-goers looking for a quick time-out with their buddies. Notable in its contemporary charm, the Burbee&rsquo;s Cafe wins the heart of youth whereas Theos and Kaffiiaa offer respite from cheap Italian versions of pizzas and pastas&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666088776download (1)1.jpg\" style=\"border-style:solid; border-width:5px; height:150px; margin:10px 50px; width:300px\" />&nbsp;<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666088840download (1)12.jpg\" style=\"border-style:solid; border-width:5px; height:150px; margin-bottom:10px; margin-top:10px; width:300px\" />