(42, 'ICC T20 World Cup 2022', 'ÙƒØ£Ø³ Ø§Ù„Ø¹Ø§Ù„Ù… ICC T20', '×’×‘×™×¢ ×”×¢×•×œ× ICC T20', 'sports, physical contests pursued for the goals and challenges they entail. Sports are part of everyÂ cultureÂ past and present, but each culture has its own definition of sports', 'Ø§Ù„Ø±ÙŠØ§Ø¶Ø© ØŒ ÙˆØ§Ù„Ù…Ø³Ø§Ø¨Ù‚Ø§Øª Ø§Ù„Ø¨Ø¯Ù†ÙŠØ© Ø§Ù„ØªÙŠ ØªØ³Ø¹Ù‰ Ù„ØªØ­Ù‚ÙŠÙ‚ Ø§Ù„Ø£Ù‡Ø¯Ø§Ù ÙˆØ§Ù„ØªØ­Ø¯ÙŠØ§Øª Ø§Ù„ØªÙŠ ØªÙ†Ø·ÙˆÙŠ Ø¹Ù„ÙŠÙ‡Ø§. ØªØ¹Ø¯ Ø§Ù„Ø±ÙŠØ§Ø¶Ø© Ø¬Ø²Ø¡Ù‹Ø§ Ù…Ù† ÙƒÙ„ Ø«Ù‚Ø§ÙØ© ÙÙŠ Ø§Ù„Ù…Ø§Ø¶ÙŠ ÙˆØ§Ù„Ø­Ø§Ø¶Ø± ØŒ ÙˆÙ„ÙƒÙ† Ù„ÙƒÙ„ Ø«Ù‚Ø§ÙØ© ØªØ¹Ø±ÙŠÙÙ‡Ø§ Ø§Ù„Ø®Ø§Øµ Ù„Ù„Ø±ÙŠØ§Ø¶Ø©', '×¡×¤×•×¨×˜, ×ª×—×¨×•×™×•×ª ×¤×™×–×™×•×ª ×©× ×¨×“×¤×• ×œ××¢×Ÿ ×”××˜×¨×•×ª ×•×”××ª×’×¨×™× ×©×”× ×›×¨×•×›×™× ×‘×”×. ×¡×¤×•×¨×˜ ×”×•× ×—×œ×§ ××›×œ ×ª×¨×‘×•×ª ×‘×¢×‘×¨ ×•×‘×”×•×•×”, ××‘×œ ×œ×›×œ ×ª×¨×‘×•×ª ×™×© ×”×’×“×¨×” ××©×œ×” ×œ×¡×¤×•×¨×˜', '<p><strong>sports</strong>, physical contests pursued for the goals and challenges they entail. Sports are part of every&nbsp;<a href=\"https://www.merriam-webster.com/dictionary/culture\">culture</a>&nbsp;past and present, but each culture has its own definition of sports. The most useful definitions are those that clarify the relationship of sports to&nbsp;<a href=\"https://www.britannica.com/topic/play-behaviour\">play</a>, games, and contests. &ldquo;Play,&rdquo; wrote the German theorist Carl Diem, &ldquo;is purposeless activity, for its own sake, the opposite of work.&rdquo; Humans work because they have to; they play because they want to. Play is autotelic&mdash;that is, it has its own goals. It is voluntary and uncoerced.&nbsp;<a href=\"https://www.merriam-webster.com/dictionary/Recalcitrant\">Recalcitrant</a>&nbsp;children compelled by their parents or teachers to compete in a game of football (soccer) are not really engaged in a sport. Neither are professional athletes if their only motivation is their paycheck. In the real world, as a practical matter, motives are frequently mixed and often quite impossible to determine. Unambiguous definition is n